import { Instagram } from "../../Utils/Icons/Instagram";

export const Footer = () => {
  return (
    <footer className="footer shadow-sm bg-blue-400 dark:bg-blue-800">
      <p className="text-dark">
        Created by <a href="https://www.instagram.com/alexhery3107/">Ignatius Alexander Hery</a>
      </p>
      <a href="https://github.com/IgnatiusAlexanderHery">
        <i className="fa fa-github"></i>
      </a>
      <Instagram url={"https://www.instagram.com/alexhery3107/"} />
      <a href="http://www.linkedin.com/in/ignatiusalexanderhery">
        <i className="fa fa-linkedin-square"></i>
      </a>
    </footer>
  );
};
